import React, { useState, useEffect } from 'react';
import axios from 'axios';

const TourRevenue = () => {
  const [revenues, setRevenues] = useState([]);

  useEffect(() => {
    fetchRevenues();
  }, []);

  const fetchRevenues = async () => {
    try {
      const response = await axios.get('/api/tour-revenues');
      setRevenues(response.data);
    } catch (error) {
      console.error('Error fetching tour revenues:', error);
    }
  };

  return (
    <div>
      <h1>Tour Revenue</h1>
      <table>
        <thead>
          <tr>
            <th>Revenue ID</th>
            <th>Tour ID</th>
            <th>Total Revenue</th>
            <th>Total Bookings</th>
            <th>Revenue Date</th>
          </tr>
        </thead>
        <tbody>
          {revenues.map((revenue) => (
            <tr key={revenue.revenue_id}>
              <td>{revenue.revenue_id}</td>
              <td>{revenue.tour_id}</td>
              <td>{revenue.total_revenue}</td>
              <td>{revenue.total_bookings}</td>
              <td>{revenue.revenue_date}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default TourRevenue;
